import React, { Component } from 'react'
import './style.css';

export default class Hero extends Component {
  render() {
    return (
      <div className="hero">
        <div className="hero__back-image">
        <div className="hero-text">
            <h1>Hello from hero</h1>
        </div>
        </div>
      </div>
    )
  }
}
